import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Header from './components/Header'; 
import Sidebar from './components/Sidebar'; 
import PairingDashboard from './components/PairingDashboard';
import PairingHistory from './components/PairingHistory'; 
import UserProfile from './components/UserProfile'; 
import Pairing from './components/Pairing';  // Updated import

function App() {
    return (
      <div className="app">
        <Header />
        <div className="main-content">
          <Sidebar />
          <div className="content">
            <Routes>
              <Route path="/" exact element={<PairingDashboard />} />
              <Route path="/history" element={<PairingHistory />} />
              <Route path="/profile" element={<UserProfile />} />
              <Route path="/pairing" element={<Pairing />} />  {/* Updated */}
            </Routes>
          </div>
        </div>
      </div>
    );
  }

export default App;
